import React from 'react';
import clinicalSkillsImages from './clinicalSkillsImages';



const clinicalSkills= ({name, image}) => {
	return(
       <div className= 'tc bg-light-green dib br3 pa3 ma2 grow bw2 shadow-5 '>
       { clinicalSkillsImages.map(images => <div> {images.image}  </div>)}
       <div> 
       <h1> {name} </h1>
       </div>
       		</div>

       		);
       	}


export default clinicalSkills;
